export default function Quiz() {
    const body=document.querySelector('body');
    body.style.backgroundColor="purple";

  return <div>
       <div className="quizContainer">
           <p className="level">QUIZ TIME</p>
           <p className="levelPage">CHOOSE DIFFICULTY</p>
           <button className="levelButton">LEVEL:1 (EASY))</button><br/>
           <button className="levelButton">LEVEL:2 (MEDIUM))</button><br/>
           <button className="levelButton">LEVEL:3 (HARD))</button>
       </div>
  </div>;
}
